import{_ as t,c as i,o as n,aj as e}from"./chunks/framework.D26WZD1w.js";const M=JSON.parse('{"title":"🏀 体育运动类社团","description":"","frontmatter":{"comment":false},"headers":[],"relativePath":"zh-cn/associations/pe&sports.md","filePath":"zh-cn/associations/pe&sports.md","lastUpdated":1758612136000}'),p={name:"zh-cn/associations/pe&sports.md"};function h(o,a,l,r,m,c){return n(),i("div",null,a[0]||(a[0]=[e('<h1 id="🏀-体育运动类社团" tabindex="-1">🏀 体育运动类社团 <a class="header-anchor" href="#🏀-体育运动类社团" aria-label="Permalink to &quot;🏀 体育运动类社团&quot;">​</a></h1><h2 id="棒球社" tabindex="-1">棒球社 <a class="header-anchor" href="#棒球社" aria-label="Permalink to &quot;棒球社&quot;">​</a></h2><p>棒球社，致力于为喜欢棒球的同学提供一个体验、学习、切磋球技的机会与平台。我们将一起系统地学习棒球的技术与规则，并在团队协作中体验棒球文化的精神内涵。对于不同水平的同学会有不同的针对性教学训练。会让体验的同学们在一次次的投球，一次次的挥棒中，不断提升技术和挑战自我。同时以棒球为契机，结识更多的朋友。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NM4WTVoRl8nmvaLtR9sLlCbnzffMmMjVnmWRL4WfMN-ZnmL0gihFp2hmCIa0nSh2U1y4MkhVL7lboRQRnzf7MzTfL77YnzCYU4vYUzlaLlQFMRnRLm74UlWFnR94MSbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="啦啦队" tabindex="-1">啦啦队 <a class="header-anchor" href="#啦啦队" aria-label="Permalink to &quot;啦啦队&quot;">​</a></h2><p>啦啦队是 BNBU 唯一的舞蹈类校队。不同于传统的啦啦队，我们在以 Jazz 为主的前提下，尝试着将其他多种舞蹈风格融合进表演，风格多变，舞种多样。</p><p>我们期待着每个喜欢舞台，热爱舞蹈的小伙伴加入我们～</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NLlnTkn7LDLzv8LtN7iMm6kLNQknz6jfozvPMz74nN7YoRl0gihFp2hmCIa0USyaLYy8okh2M7UbLlVfL4-DLmNPLR-YU467Uzn7nzMVnlVFMmG8MlL8oRAFMNnfnkbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="弓道社" tabindex="-1">弓道社 <a class="header-anchor" href="#弓道社" aria-label="Permalink to &quot;弓道社&quot;">​</a></h2><p>弓道是日本的一种竞技运动，起源于六艺“礼、乐、射、御、书、数” 中的“射”，即射箭。弓道不仅强身健体，更追求精神上的修养。 弓道社是 BNBU 成立最早的学生社团之一，十余年来已形成稳定的管理架构和合理的教学体系，同时也具备全套公用训练装备，对新手十分友好。</p><p>社团利用课余时间组织训练，定期举行内部比赛和对外交流赛，每逢重要节日还会举办射会活动，组织晚会和聚餐，加深社员们的感情。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NnzGT8U8WVolU8Ut8lDUz7Dol78Uz9jPUmv4M7-YM4ARUml0gihFp2hmCIa0LkyPLYyaLSyDM8C4MNUZLmvinRl8UNCsUN-DoR-PM4vio7rFL7U4UzM2oRVFnlMRLSbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="剑道俱乐部" tabindex="-1">剑道俱乐部 <a class="header-anchor" href="#剑道俱乐部" aria-label="Permalink to &quot;剑道俱乐部&quot;">​</a></h2><p>剑道俱乐部是基于“仁”“义”“礼”“智”“信”、禅心正剑等思想成立的社团。</p><p>在提供全套防护装备的前提下，会为感兴趣的同学们提供专业完善的训练课程。社团旨在通过激烈的实战磨练社员的身心，通过实行完整的行礼机制培养社员尊师重道的礼仪。进而塑造顽强自立、与人为善的人格。</p><p>剑道训练是社团的日常活动。闲暇时间我们还会经常组织聚餐等团建活动。社团也会鼓励并且带领社员参加有世界剑道联盟认证的考级、考段和比赛。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NLNLTYozG8M7-PUtlQfnzAVnz9YUlLjinRvYn7rRLNlsM8L0gihFp2hmCIa0nkhVMkh7oSyDM7rRnmU4olCPnRGaMzCaMzNZU4-Pnm7sL46FUl7aolUaMmnFnmv8U1baptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="羽毛球协会" tabindex="-1">羽毛球协会 <a class="header-anchor" href="#羽毛球协会" aria-label="Permalink to &quot;羽毛球协会&quot;">​</a></h2><p>羽毛球协会是 BNBU 羽毛球爱好者的交流平台，干事与会员均在招募中。会员招聘无门槛，只用一学年交 90-110 元会费（具体金额视情况定）即可入会享受每周四次左右的会员打球活动（免场地费，球费），同时学期间协会会组织不定期的单双打交流赛和相关的羽毛球兴趣活动。干事则为协会管理者，分为策划部，财务部，宣传部，行政部四大部门，需要经过面试入选。干事同时免费享有会员权益。</p><p>欢迎羽毛球爱好者加入羽协的大家庭！</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NMmnTVnRC4LmQkot7L8M77iLRW2MzGj8oR9DoRTkM7-8MzU0gihFp2hmCIa0M1hfMkhkMYhVL8l8ozvbLzUaoR9iMRliozvaUmC8UzNZUz6FozLYM8M2ozfFnm-bMYbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="网球俱乐部" tabindex="-1">网球俱乐部 <a class="header-anchor" href="#网球俱乐部" aria-label="Permalink to &quot;网球俱乐部&quot;">​</a></h2><p>网球俱乐部，创立于 2010 年，原网球协会。我们致力于为全校师生提供网球交流平台，提供更多样的运动选择。</p><p>我们在校内体育馆及会同体育公园的网球场定期活动时间，同时社团提供充足的网球拍和网球器材。</p><p>我们为内部成员提供不同阶段的日常训练，除此之外我们将举办网球公开比赛，让网球爱好者们都有机会展示自己，让更多师生了解网球运动。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NL8-TaMzN4L4fRntzLYUzGDnNUDnNQjVUl-sUlWVoRUbM770gihFp2hmCIa0okh7UYhRoSyPoz-8nm9inm-sLR9aMl-iLlrfM7lYMNUinNnFMmN4oRT2UmTFM4lsUSbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="乒乓球协会" tabindex="-1">乒乓球协会 <a class="header-anchor" href="#乒乓球协会" aria-label="Permalink to &quot;乒乓球协会&quot;">​</a></h2><p>乒乓协会以丰富同学们的校园生活，推广乒乓运动为宗旨，为同学们提供了一个结识球友、切磋交流的平台。在日常活动中，我们提供给同学们每周一次的免费训练场地。在非日常活动中，有小球嘉年华这样的趣味乒乓活动，让乒乓小白们体验乒乓球的魅力，也有各种乒乓赛，给乒乓大神们提供了一个刺激的比赛平台。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NM49TiLRnRL7QRMtzQRn7Q2Mzn7M4VjVnN-bnz7PM8LsUN-0gihFp2hmCIa0oSybUSyZMSyZo7L8nzNaMzLiU46fnRU4L4N8UNWfnNl8UNMFnm6knN7iL4nFU4M2oSbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="跆拳风之社" tabindex="-1">跆拳风之社 <a class="header-anchor" href="#跆拳风之社" aria-label="Permalink to &quot;跆拳风之社&quot;">​</a></h2><p>想练就一身灵敏矫健的好筋骨吗?想塑造坚韧不拔的高尚品格吗? 欢迎加入跆拳风之社，这里有认真负责的黑带六段专业教练，有英姿飒爽、热心包容的学长学姐，有丰富多元的活动，不止于腿法体验、高校交流、舞台表演，零基础的小白也能从容走向黑带巅峰。来和我们一起，在大学生活的浪尖欣赏最美的风景。风里雨里，跆社等你!</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NM4GT8Ml-YnNr7UtmGZMNUiMzUbUmGjZnNliozTkoR98U490gihFp2hmCIa0L1yiokyZM1yPMlC8L4W2Mm7aoRAVMNVfnRrkLR-8L8MVMRMFL8nkMRLaoRrFLl74LlLJv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YoR9Jqdwnx&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="桌面运动协会" tabindex="-1">桌面运动协会 <a class="header-anchor" href="#桌面运动协会" aria-label="Permalink to &quot;桌面运动协会&quot;">​</a></h2><p>桌面运动协会致力于在 BNBU 校园中推广桌面游戏，让大家能认识与接触这种别具一格的游戏种类。我们每周都会有日常活动，既能让参加的大家感受到桌游的趣味，还能放松因学业而劳累的身心，让盯了一周屏幕的眼睛休息一下，同时也能够在游戏的过程中认识新的朋友。一举三得，岂不美哉~</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NMmnT2LRAknR78Lt4GYnNlDM8WRMRfjkL494nzNiL4VRMzv0gihFp2hmCIa0nkyiMYhkUShkLR78MzL4LR-YnllinRC4oRCbUzfVMRr7LzVFUlL4U4GDLNVFoz9PMkbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="足球协会" tabindex="-1">足球协会 <a class="header-anchor" href="#足球协会" aria-label="Permalink to &quot;足球协会&quot;">​</a></h2><p>北师-香港浸会大学足球协会旨在通过组织和举办各类足球赛事，推广足球运动，提升校园足球文化氛围，促进会员之间的交流与合作。协会致力于以专业化发展为目标，为所有热爱足球的学生提供一个公平、公正、专业的竞技平台。我们通过推动校园足球文化、组织高水平赛事、促进会员交流与合作、注重专业化发展、提供多样化参与机会和倡导健康生活方式，期待将足球运动带给更多的学生，成为校园内不可或缺的一部分，培养更多优秀的足球人才和爱好者。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NU87TbU49sUm9DMt77bnRLPL4WkolljDUmLPMzviM7CDnR-0gihFp2hmCIa0LSyZL1hRoShRnRM7LRCPMNMRM4rfL7l4L4fkolCZoz9DUmTFnRUbUl-iLlnFnN7iU1baptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="极限飞盘社" tabindex="-1">极限飞盘社 <a class="header-anchor" href="#极限飞盘社" aria-label="Permalink to &quot;极限飞盘社&quot;">​</a></h2><p>极限飞盘社由一群阳光、热血、开朗的飞盘爱好者组成。自建社以来，我们始终致力于普及与宣传飞盘这项运动，为飞盘兴趣者提供体验和学习飞盘的机会和途径，向师生呈现积极向上的飞盘运动氛围，为盘友们提供充满竞技性交流切磋平台。在飞盘社各部门的共同努力下我们在今年荣升三星级社团，并一直秉持着富有创新，不懈拼搏，勇于进取，永不言弃的精神。盘不落地，永不放弃，飞盘不只是一种运动，更是一种精神！</p><p>极限飞盘社欢迎每一个活力满满的你。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NMNWTko7VfU4WVLtzUsLmvPMN-PUmGjZUllaMmLDUmCinN-0gihFp2hmCIa0oShknSyDM1ybnzUPL7CZM4MVLlVfL8-Zoz9in774L4ffLNMFL4-YnRvZozrFnmvDnkbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="太极社" tabindex="-1">太极社 <a class="header-anchor" href="#太极社" aria-label="Permalink to &quot;太极社&quot;">​</a></h2><p>太极社，是一个致力于传承和推广中国传统武术的社团，由教学部、文宣部和总务部组成。我们不仅会教授杨式、陈式等不同流派的太极拳，还会教授太极扇、太极剑等兵器的使用方法。我们还会开设太极推手体验活动，让你感受太极的对抗和合作。我们还会定期举办功夫电影放映会，让大家欣赏武术的魅力和艺术。此外，我们也会参与一些武道展示活动，展现太极社的风采和实力。</p><p>太极社欢迎所有对武术感兴趣的同学加入，无论你是初学者还是高手，都可以在这里找到属于你的太极之道。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NMRfTfMR9DnRG8ntNrRUlQ7oR-YUlVjkLRvsMR62LzT7oRG0gihFp2hmCIa0nkhVnkyPMYyZMNU4n7rVnRU8nR-iU87bL7r7n7nfUmWkM4rFnmf2nRA7MRTFnllbMkbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="合气道社" tabindex="-1">合气道社 <a class="header-anchor" href="#合气道社" aria-label="Permalink to &quot;合气道社&quot;">​</a></h2><p>合气道是源于日本大东流合气柔术的近代武术，讲究以弱克刚，借力使力。合气道社创办于 2011 年，荣获武术类三星社团，每周两次日常训练，曾协同多个社团主办武道展，十三社团体验营等活动；每学期都会有前往校外道馆校外交流会，期末举办授段考试。我们的师父梁锡钧先生是前澳门特警队武术教练，曾在澳门警队中教授防身擒拿术，练习合气道逾三十载，现为日本合气道黑带二段。日后江湖凶险，来合气道社学习优雅利落的身法吧！</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NMzLT4U4QkUll8ntmQRM7-ZUmUsLzWj2MRNZLRNPM4nVLRv0gihFp2hmCIa0n1yPU1ybnSy8M4UbUlQRU4liL4lDozQ7o7lDU4L4oz6kLRQFnmM2nznkLmMFLzUZU4LJqjfjo4OeosrXCih4CIy0qIbtpYyPLzlag47YoR9Jqdwnx&amp;tid=1150&amp;nid=1288&amp;e=.jpg" width="100" height="100"></p><h2 id="舞灵社" tabindex="-1">舞灵社 <a class="header-anchor" href="#舞灵社" aria-label="Permalink to &quot;舞灵社&quot;">​</a></h2><p>舞灵社 (Inspiration Dance)，成立于 2012 年 10 月。作为 BNBU 唯一独立的主打经典舞蹈的社团，舞灵社涵盖了芭蕾、拉丁、现代、古典、民族等多个舞种，致力于传播区别于当下流行舞蹈的经典舞蹈，在这里，我们尊重每一个舞台与每一位观众，享受每一束聚光灯与欣赏的眼神，在这里，我们为热爱挥洒汗水，为梦想踮起脚尖，找寻属于自己的光芒！</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NLR7TPnmNYnzVRntz7PMmliLz-anRNjDM8UYMmUZoRM2L8L0gihFp2hmCIa0okybMYysUShkMN7DL4G4Uz7bM8lsnRLinRQVU8r7MNn7L46FUlMRUzVkMNWFn7-PLYbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="街舞社" tabindex="-1">街舞社 <a class="header-anchor" href="#街舞社" aria-label="Permalink to &quot;街舞社&quot;">​</a></h2><p>街舞社又名 UICCREW，是校内唯一的街舞类社团，开设 Hiphop，Jazz，Freestyle 三大主舞队，辅修Locking，Waacking，Dancehall 等舞种，力求打造一个多元化的舞蹈集体。 每周设有大小队训各一次，大师课福利不定期掉落。编排，演出，回归街头，学校各大晚会都有我们的身影。</p><p>每年五月举办王牌活动舞王圣夜，联合十余所高校及 Studio 为大家献上精彩纷呈的街舞盛宴。 心怀对舞蹈的热爱，用街舞传递 love and peace。我们期待你的加入！</p><p>I see no floor, Immersed in it.</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NnRrTVLmLDnNnfntz-Yn7CaM4VkM46jRMNLbLm7anlUaMz90gihFp2hmCIa0n1yZM1yioSy8nNCboRA7LlL4LmCZMz7ZnmLZMzn2Mm6Vo7WFnRfkLllDMmVFU4VkM1baptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="u-skate-滑板社" tabindex="-1">U-SKATE 滑板社 <a class="header-anchor" href="#u-skate-滑板社" aria-label="Permalink to &quot;U-SKATE 滑板社&quot;">​</a></h2><p>US 滑板社致力于为 BNBU 滑手提供一个交流、学习的平台，让更多的人了解、接触到滑板、轮滑文化。</p><p>我们有：</p><ul><li><p>每周官方约滑+日常约滑：集体练招+零基础教学</p></li><li><p>滑板体验日：双翘、长板、陆冲零基础体验与教学（配有护具）</p></li><li><p>潮流体验文化夜、刷街—回归街头、滑板露营、板店探访等丰富活动。</p></li></ul><p>用滑对抗生活的杂乱，用轮抹平时光的细碎，US滑轮社，期待你的到来！</p><p>了解更多资讯欢迎关注本社公众号。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NM4TTVUzfVM4lZMtzvbMzUsM49aLRvjZoRTkLlUYL4viozG0gihFp2hmCIa0MYyPUYyZokyDU467LmLPLln2nzGaLRUYnzNPM8rfM7nkLzWFMmUDMmrVLNVFLlQfnm7Jv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YoR9Jqdwnx&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="野蜂户外运动社" tabindex="-1">野蜂户外运动社 <a class="header-anchor" href="#野蜂户外运动社" aria-label="Permalink to &quot;野蜂户外运动社&quot;">​</a></h2><p>哈喽 ，我们是 Wild-beE 野蜂户外运动社，全 BNBU 最能带你爬山涉水，开荒海吃的社团。Wild-beE 野蜂户外运动社,今年7岁，是校内唯一的野外生存类运动社团。名字出自顾城的《两地》：</p><blockquote><p>在爱人的心上<br> 在清澈的泉流旁<br> 住着一群小野蜂<br> 早上嗡嗡嗡<br> 晚上不做声<br> 《两地》—— 顾城</p></blockquote><p>我们是一群热爱户外运动的人，也想把这份热爱送到每个 BNBUer 的心里。我们不断组织户外运动，推动大家接触，体验和认识自然，和大家走出水泥钢筋，释放又野又疯的自我。我们一步步学习和成长，希望给大家带来越来越棒的户外体验。目前社团活动包含：登山，露营，定向越野，骑行。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NozWT2UzL8UzLZMtR7YL8MVMmUsn7VjVM46RL7lDozQfLll0gihFp2hmCIa0USybUSyinkhRnmQ7L8-bUN7bUlr2U4-aMm-Yoln2n7-ZMlrFUml8UlCZUlWFn7-DM1baptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="篮球协会" tabindex="-1">篮球协会 <a class="header-anchor" href="#篮球协会" aria-label="Permalink to &quot;篮球协会&quot;">​</a></h2><p>BNBUBA，全称北师港浸大篮球协会，是 BNBU 的篮球爱好社团，是由热爱篮球运动的篮协人共同组成的大家庭。篮协致力于推动校园篮球文化的传播与发展，各类大型校园篮球活动的策划与开展，力求为全校师生营造让大家舒心参与，良好向上的篮球氛围。</p><p>篮协由行政部、宣传部、策划部及裁判委员会构成。</p><p>在篮协人共同的努力下，成功举办了篮球嘉年华（新生杯）、校友返校日友谊赛、澳科大交流赛、校男女篮系赛（协办）等活动。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NMRLTZL7C8L7V2UtmMRUmUZozARoRrjfMm67Mzl4U4vYnRv0gihFp2hmCIa0MSyYnSh2nkyZM4W2ozLaozUYMzv8oznkMzC4oRNPo7-DLmMFUln7L4LDU4MFM8Mkokbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="联合健身协会" tabindex="-1">联合健身协会 <a class="header-anchor" href="#联合健身协会" aria-label="Permalink to &quot;联合健身协会&quot;">​</a></h2><p>健身协会是致力于倡导全民健身，发展健身爱好，发扬校内健身文化，聚集健身爱好者的校内学生自治组织。我们安排日常训练，互相汲取经验；做健身知识讲座，推广健身文化；组织大型活动，掀起校内健身热潮。无论你是小白还是大佬，只要热爱健身，这里总有你的一席之地！欢迎你成为 BNBU Fitness 的一员，我们在健协等你！</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NLmrT7MRfVLNCYotRWVLNVVU4ARLzvj4nz9anR9iLmQ2nz70gihFp2hmCIa0n1y4LSyYokyZn7n2LlLsMzv8LmQfnlVVnm62MNWkLzGinRAFnzM7L4nVM4rFnz6Rokbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="皮划艇俱乐部" tabindex="-1">皮划艇俱乐部 <a class="header-anchor" href="#皮划艇俱乐部" aria-label="Permalink to &quot;皮划艇俱乐部&quot;">​</a></h2><p>皮划艇俱乐部是 BNBU 唯一的水上运动社团，也是唯一一个可以在学校的大池子里活动的社团哟！！</p><p>我们是由一群热爱冒险、追求自由、开放包容的水上运动爱好者组成的社群。无论你是刚刚听说还是领域大 pro，无论是皮划艇、桨板还是冲浪都能在这里找到合适的搭子！！</p><p>在湛蓝海面上，我们挥桨畅游，感受风与水的融合；在激流急湍中，我们勇敢冲锋，超越极限。皮划艇不仅锻炼身体，更是团结友谊的纽带。在这里，你将结交志同道合的伙伴，探索未知的刺激与快乐！！</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NL4-TsLRVRnm-aUtlV2LRNsnzTkM8MjVoR7bMmWVM4VfU4G0gihFp2hmCIa0LkyPMkh2MkybUzWko778LRMfUzNsU46VozAfM7-ZoRLbUlrFM478LlCYnz6FLzG4MN-Jv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YoR9Jqdwnx&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="高尔夫交流社" tabindex="-1">高尔夫交流社 <a class="header-anchor" href="#高尔夫交流社" aria-label="Permalink to &quot;高尔夫交流社&quot;">​</a></h2><p>高尔夫交流社成立于 2023 年，是由 2022 级的高尔夫爱好者组织成立的具有很强交流属性的体育运动类社团。高尔夫交流社热衷于为热爱高尔夫的同学提供相互学习、精进球技、沟通交流的平台（社团欢迎零基础的同学并将提供专业的技术指导）；旨在以高尔夫球为媒介促进同学、师生、校友之间的交流，并致力于培养学生的交际能力。社团会定期邀请嘉宾（包括校内教授、校友以及企业家）与社团成员校园进行球技切磋与交流，以此增进同学升学、就业经验并扩大交际圈子。此外，社团还会定期组织与其他高校的联谊活动，以及参加国内的高校赛事。社团每两到三周会策划一次校外的活动，同时也会不定时地在校内发起一些活动。会员可根据自己的时间和兴趣，在丰富的活动中选择参加。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NU4QTkU4UYnzrkUtzffLzl4UlQ2L4Wj7LRT7M4UsUlUsozG0gihFp2hmCIa0LkhRnSyDUYyDMRlZMl-aUmCiLNUbM7l8Ml-PUzQVM4rkMzTFozLZMRL8nmWFL46kokbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="橄榄球社" tabindex="-1">橄榄球社 <a class="header-anchor" href="#橄榄球社" aria-label="Permalink to &quot;橄榄球社&quot;">​</a></h2><p>橄榄球社是一个充满活力和热情的地方，致力于让每个人都能享受到橄榄球的乐趣。这里既适合初学者学习基础技能，也欢迎资深球员来提升自己的水平。通过举办定期的友谊赛和技术训练，我们提供了一个完美的平台，让大家可以在轻松愉快的环境中进步和成长。更重要的是，这里你会遇到一群和你一样热爱橄榄球的朋友。我们相信，通过共同的爱好，能够紧密联系每一个成员，共同构建一个温馨、友爱的社区氛围。加入我们橄榄球社团，一起享受橄榄球带来的无限快乐！</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NnmvTDUzGZM4VVntlWRnm7bMzARMNLjbo77DM4WRo7-PoR70gihFp2hmCIa0MSy4LSyYokyPMN-PL8LPUlnRMR7iM8CZL8CYLNL8oz94o7VFnz-Yo7laLmTFM46kLYb/v2veo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.jpg" width="100" height="100"></p><h2 id="排球社" tabindex="-1">排球社 <a class="header-anchor" href="#排球社" aria-label="Permalink to &quot;排球社&quot;">​</a></h2><p>本社团旨在为全校排球热爱者们提供更好的氛围与环境，拓宽师生体育锻炼选择范围，提高学生身体素质；在校园中推广排球运动和相关知识，组织体验活动并丰富学生校园生活；组织队伍参加比赛为学校争光。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NU46T7U87inl78MtNQfU4-inmvYLmQjVL4GbnRCYn7n2LzC0gihFp2hmCIa0n1h7LkyYn1hfo7M2nNL4oRvZUNQRnmvZnRUsUmARnmlPLmrFnRfVLmlsM8VFL4TkMYbaptveo4Oe6ITm5sMApYhXptQ0g47PMzG0Lz-Zokbw62w8c&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p><h2 id="拳击社" tabindex="-1">拳击社 <a class="header-anchor" href="#拳击社" aria-label="Permalink to &quot;拳击社&quot;">​</a></h2><p>拳击社成立于 2025 年，致力为校内拳击爱好者提供专业且系统的训练平台。社内配有拳击专业设备，社团指导老师曾随省队训练 2 年及多次参加比赛。加入我们你将得到从基础动作到实战技巧的全面提升，既能高效燃脂锻炼身体，也能深入学习拳击技术。无论是零基础的新手，还是有经验的拳击爱好者，都能在这里找到适合自己的节奏。</p><p align="center"><img src="https://sao.uic.edu.cn/virtual_attach_file.vsb?afc=NU8WTVMzCbMNUZLt4T7UzLiLmA7U4ljsMmV2nRM7ozUaUlL0gihFp2hmCIa0LYhRnkyDoShfLR7ZMzCaL874LNVkMzfVMzfkL87iLRvDnznFMRM7L8LDL7nFLzfRLR7Jv2bjo4OeosrXCih4CIy0qIbtpYyPLzlag47YoR9Jqdwnx&amp;tid=1150&amp;nid=1288&amp;e=.png" width="100" height="100"></p>',94)]))}const L=t(p,[["render",h]]);export{M as __pageData,L as default};
